#define ABB_TX_3G_ANA_2_2_lpf_mode_3g_2_END            (5)
#define ABB_TX_3G_ANA_2_2_tx_mode_clk_3g_b3_2_START    (7)
#define ABB_TX_3G_ANA_2_2_tx_mode_clk_3g_b3_2_END      (7)


