#define ABB_TX_4G_ANA_2_2_current_mode_op2_4g_2_END    (3)
#define ABB_TX_4G_ANA_2_2_lpf_mode_4g_2_START          (4)
#define ABB_TX_4G_ANA_2_2_lpf_mode_4g_2_END            (5)
