#define ABB_REG_ANALOG_WR39_2_dum_en_q_2_END         (0)
#define ABB_REG_ANALOG_WR39_2_dum_en_i_2_START       (1)
#define ABB_REG_ANALOG_WR39_2_dum_en_i_2_END         (1)
#define ABB_REG_ANALOG_WR39_2_tx_vcm_adjust_2_START  (2)
#define ABB_REG_ANALOG_WR39_2_tx_vcm_adjust_2_END    (3)
#define ABB_REG_ANALOG_WR39_2_tx_vcm_sel_2_START     (4)
#define ABB_REG_ANALOG_WR39_2_tx_vcm_sel_2_END       (4)
#define ABB_REG_ANALOG_WR39_2_tx_clkd_ctrl_2_START   (5)
#define ABB_REG_ANALOG_WR39_2_tx_clkd_ctrl_2_END     (5)


